'''Tramps''' are poor humans living on the street in various cities throughout RuneScape. They apparently own the [[Pelters' Veg Stall]]s, accessible through a crate located near the [[Pillory|pillories]] in the cities they inhabit, where they sell [[rotten tomato]]es for 1 coin each. They cannot be directly interacted with, but they will throw [[rotten tomato]]es at any player locked up in the pillory nearby, while yelling at the player.

